import NavBar from "./Components/NavBar/NavBar.js";
import { Routes, Route } from "react-router-dom";
// page
import NotFound from "./Containers/NotFound/NotFound.js";
import Home from "./Components/Home/Home";
import About from "./Components/About/About";
import Profil from "./Components/Profil/profil";
import Services from "./Components/Services/Services";
import Ventes from "./Components/Services/Ventes/Ventes";
import Remorquage from "./Components/Services/Remorquage/Remorquage";

function App() {
	return (
		<div>
			<NavBar />
			<Routes>
				<Route path="/"></Route>
				<Route path="/services">
					<Route path="/services/ventes"></Route>
					<Route path="/services/remorquage"></Route>
				</Route>
				<Route path="/about" element={<About />}></Route>
				{/* chemin dynamique evc :id */}
				<Route path="/profil/:id" element={<Profil />}></Route>
				{/* chemin unknow */}
				<Route path="*" element={<NotFound />}></Route>
			</Routes>
		</div>
	);
}

export default App;
